import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Line } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
} from 'chart.js';

// Register chart components
ChartJS.register(CategoryScale, LinearScale, PointElement, LineElement, Title, Tooltip, Legend);

function StockData() {
  const [symbol, setSymbol] = useState('');
  const [data, setData] = useState(null);
  const [chartData, setChartData] = useState(null);
  const [error, setError] = useState('');
  const [timeFrame, setTimeFrame] = useState('1w'); // Default timeframe

  // Function to fetch stock data from the backend
  const fetchData = async (stockSymbol, timeFrame) => {
    try {
      const response = await axios.get(`http://localhost:5000/stock/${stockSymbol}?timeframe=${timeFrame}`);
      setData(response.data);

      // Process data for the graph
      if (response.data && response.data.history) {
        const history = response.data.history;
        const dates = history.map((item) => item.date);
        const prices = history.map((item) => item.price * 82.75); // Convert to INR (example rate: 1 USD = 82.75 INR)

        setChartData({
          labels: dates,
          datasets: [
            {
              label: `Price of ${stockSymbol.toUpperCase()} in INR`,
              data: prices,
              borderColor: 'rgba(75, 192, 192, 1)',
              backgroundColor: 'rgba(75, 192, 192, 0.2)',
              fill: true,
            },
          ],
        });
      }

      setError('');
    } catch (err) {
      setError('Failed to fetch data. Please try again.');
      console.error('Error:', err.message);
    }
  };

  // Handle the search
  const handleSearch = () => {
    if (!symbol) {
      setError('Please enter a stock symbol.');
      return;
    }
    fetchData(symbol, timeFrame);
  };

  // Handle timeframe change
  const handleTimeFrameChange = (e) => {
    setTimeFrame(e.target.value);
    if (symbol) {
      fetchData(symbol, e.target.value);
    }
  };

  return (
    <div style={{ padding: '20px', fontFamily: 'Arial, sans-serif' }}>
      <h1 style={{ textAlign: 'center', color: '#007BFF' }}>Stock Data Viewer</h1>

      <div style={{ marginBottom: '20px', textAlign: 'center' }}>
        <input
          type="text"
          placeholder="Enter Stock Symbol (e.g., AAPL)"
          value={symbol}
          onChange={(e) => setSymbol(e.target.value)}
          style={{
            padding: '10px',
            marginRight: '10px',
            width: '300px',
            borderRadius: '5px',
            border: '1px solid #ccc',
          }}
        />
        <button
          onClick={handleSearch}
          style={{
            padding: '10px 20px',
            borderRadius: '5px',
            border: 'none',
            backgroundColor: '#007BFF',
            color: 'white',
            cursor: 'pointer',
          }}
        >
          Search
        </button>
      </div>

      <div style={{ marginBottom: '20px', textAlign: 'center' }}>
        <label htmlFor="timeframe" style={{ marginRight: '10px', fontWeight: 'bold' }}>Select Timeframe:</label>
        <select
          id="timeframe"
          value={timeFrame}
          onChange={handleTimeFrameChange}
          style={{ padding: '10px', borderRadius: '5px', border: '1px solid #ccc' }}
        >
          <option value="1w">1 Week</option>
          <option value="1m">1 Month</option>
          <option value="historical">Historical</option>
        </select>
      </div>

      {error && <p style={{ color: 'red', textAlign: 'center' }}>{error}</p>}

      {chartData ? (
        <div style={{ marginTop: '20px' }}>
          <Line
            data={chartData}
            options={{
              responsive: true,
              plugins: {
                legend: {
                  position: 'top',
                },
                title: {
                  display: true,
                  text: `Price Data for ${symbol.toUpperCase()} in INR`,
                },
              },
            }}
          />
        </div>
      ) : (
        <p style={{ textAlign: 'center' }}>No chart data available. Please search for a stock symbol.</p>
      )}
    </div>
  );
}

export default StockData;
